#define DRUM_PRESET DIP0
#define DRUM_GAIN DFP0
#define DRUM_BPM DFP1

const drum_params_manifest_t drum_params_manifest = {
		//name		def		min		max					qual		micro	macro
		.int_params_manifest[DRUM_PRESET] = {	"preset", 	0,		0,		PRESETS_COUNT-1,	DRUM_PS,	1,		1		},
		.float_params_manifest[DRUM_GAIN] = {	"gain", 	0.F,	-10.F, 	10.F,				DRUM_DB,	0.2F,	1.F		},
		.float_params_manifest[DRUM_BPM] = {	"bpm", 		100.F,	50.F,	200.F,				DRUM_VALUE,	1.F,	10.F	}
};

void Drum_Init(drum_conf_t *conf) {
#ifdef F407
	for (uint8_t i = 0; i < DRUM_INT_PARAMS_COUNT; i++) {
		conf->int_params[i] = drum_params_manifest.int_params_manifest[i].def;
	}
	for (uint8_t i = 0; i < DRUM_FLOAT_PARAMS_COUNT; i++) {
		conf->float_params[i] = drum_params_manifest.float_params_manifest[i].def;
	}
	conf->active = 0;
	conf->counter = 0;
#endif
}


void Drum_Playback(float *value, drum_conf_t *conf) {
#ifdef F407

	// cache for exponential gain
	static float cache_x = ILLEGAL_VAL;
	static float cache_y = ILLEGAL_VAL;

	if (conf->active && conf->int_params[DRUM_PRESET] < PRESETS_COUNT) {

		// vars used for each voice
		const drum_preset_manifest_t *preset = &drum_presets_manifest[conf->int_params[DRUM_PRESET]];
		float vals_per_beat = 2880000.F / conf->float_params[DRUM_BPM]; // 48000.F * 60.F / bpm
		int32_t temp_value = 0;
		float gain_multiplier = 1;
		if (conf->float_params[DRUM_GAIN] == cache_x) {
			gain_multiplier = cache_y;
		} else {
			cache_y = expf(conf->float_params[DRUM_GAIN]*0.230258509F);
			cache_x = conf->float_params[DRUM_GAIN];
			gain_multiplier = cache_y;
		}

		for (uint8_t i = 0; i < VOICES_COUNT; i++) {

			if (preset->voices[i].bars_count) {
				// how many cycles occur in each beat
				//float _vals_per_beat = 48000.F * 60.F / bpm;
				//uint32_t vals_per_beat =_vals_per_beat;

				// shift counter by how many vals are in a voice
				float vals_in_voice = preset->voices[i].bars_count * preset->beats_per_bar * vals_per_beat;
				uint32_t c = conf->counter % (uint32_t)vals_in_voice;

				uint32_t vals_until_c = 0;
				uint8_t current_sound = 0;
				uint32_t current_sound_counter = 0;
				uint8_t sound_found = 0;
				// find which note is playing and at which val the sample is
				uint8_t j = 0;
				while(!sound_found && j < preset->voices[i].notes_count) {
					float vals_per_current_note = preset->beats_per_bar * preset->voices[i].notes[j].duration * vals_per_beat;
					if (c >= vals_until_c && c < vals_until_c + (uint32_t)vals_per_current_note) {
						sound_found = 1;
						current_sound = preset->voices[i].notes[j].sound;
						current_sound_counter = c - vals_until_c;
						// note is found and should be played
					} else {
						vals_until_c += (uint32_t)vals_per_current_note;
						j++;
					}
				}

				temp_value += sample_play(current_sound, current_sound_counter);
			}
		}

		*value += (float)temp_value * gain_multiplier;

		if (*value > MAX_VAL) {
			*value = MAX_VAL;
		} else if (*value < MIN_VAL) {
			*value = MIN_VAL;
		}

		conf->counter++;
	}
#endif
}

void Drums_GetParamsByType(uint8_t active_index, uint8_t *_int, uint8_t *i) {
	uint8_t active_params = 0;
	for (uint8_t j = 0; j < DRUM_INT_PARAMS_COUNT; j++) {
		if (active_params == active_index) {
			*_int = 1;
			*i = j;
			return;
		}
		active_params++;
	}
	for (uint8_t j = 0; j < DRUM_FLOAT_PARAMS_COUNT; j++) {
		if (active_params == active_index) {
			*_int = 0;
			*i = j;
			return;
		}
		active_params++;
	}
}





